<!DOCTYPE html>
<html>
<head>
    <title>Riyadh Road Network - Traffic Flow Visualization</title>
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>

    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: Arial, sans-serif; }
        #map { width: 100%; height: 100vh; }
        .panel { position: absolute; top: 10px; right: 10px; background: white; padding: 15px; border-radius: 8px; z-index: 1000; width: 320px; max-height: 90vh; overflow-y: auto; box-shadow: 0 2px 15px rgba(0,0,0,0.2); }
        .panel h3 { color: #2c3e50; margin-bottom: 10px; font-size: 14px; }
        .legend { margin: 15px 0; padding: 10px; background: #f8f9fa; border-radius: 4px; }
        .legend-title { font-weight: bold; margin-bottom: 8px; font-size: 12px; }
        .legend-item { display: flex; align-items: center; margin: 4px 0; font-size: 11px; }
        .legend-color { width: 25px; height: 4px; margin-right: 8px; border-radius: 2px; }
        .trip-btn { display: block; width: 100%; padding: 8px 10px; margin: 4px 0; background: #3498db; color: white; border: none; border-radius: 4px; cursor: pointer; text-align: left; font-size: 11px; }
        .trip-btn:hover { background: #2980b9; }
        .trip-btn.active { background: #27ae60; }
        .section { margin-top: 15px; padding-top: 15px; border-top: 1px solid #eee; }
        .section-title { font-weight: bold; margin-bottom: 8px; font-size: 12px; color: #2c3e50; }
        .stats { font-size: 11px; color: #7f8c8d; line-height: 1.6; }
        .controls label { display: block; margin: 5px 0; font-size: 11px; cursor: pointer; }
    </style>
</head>

        var flowLayers = [];
        var tripLayers = [];
        var currentTrip = null;

        // Draw flow network
        function drawFlow() {
            roads.forEach(r => {
                var line = L.polyline([[r.coords[0][1], r.coords[0][0]], [r.coords[1][1], r.coords[1][0]]], {
                    color: r.color,
                    weight: r.flow > 0 ? 2 : 1,
                    opacity: r.flow > 0 ? 0.8 : 0.3
                });
                line.bindPopup('GID: ' + r.gid + '<br>Flow: ' + r.flow.toFixed(0));
                flowLayers.push(line);
                line.addTo(map);
            });
        }

        function toggleFlow() {
            var show = document.getElementById('showFlow').checked;
            flowLayers.forEach(l => show ? l.addTo(map) : map.removeLayer(l));
        }

        function clearTrip() {
            tripLayers.forEach(l => map.removeLayer(l));
            tripLayers = [];
        }

        function toggleTrip() {
            var show = document.getElementById('showTrip').checked;
            tripLayers.forEach(l => show ? l.addTo(map) : map.removeLayer(l));
        }

        function loadTrip(idx) {
            clearTrip();
            currentTrip = idx;
            var trip = trips[idx];
            document.getElementById('showTrip').checked = true;
            
            // GPS track
            if (trip.gps.length > 0) {
                var gpsLL = trip.gps.map(c => [c[1], c[0]]);
                var gpsLine = L.polyline(gpsLL, {color: '#e74c3c', weight: 4, dashArray: '8,8'});
                tripLayers.push(gpsLine);
                gpsLine.addTo(map);
            }
            
            // Matched route
            if (trip.matched.length > 0) {
                var matchLL = trip.matched.map(c => [c[1], c[0]]);
                var matchLine = L.polyline(matchLL, {color: '#3498db', weight: 5});
                tripLayers.push(matchLine);
                matchLine.addTo(map);
                
                // Start/end
                var start = L.circleMarker(matchLL[0], {radius: 10, color: '#fff', weight: 2, fillColor: '#27ae60', fillOpacity: 1});
                var end = L.circleMarker(matchLL[matchLL.length-1], {radius: 10, color: '#fff', weight: 2, fillColor: '#9b59b6', fillOpacity: 1});
                tripLayers.push(start, end);
                start.addTo(map);
                end.addTo(map);
                
                map.fitBounds(matchLL, {padding: [50, 50]});
            }
            
            document.querySelectorAll('.trip-btn').forEach((b, i) => b.classList.toggle('active', i === idx));
        }

        // Build trip buttons
        var container = document.getElementById('trips');
        trips.forEach((t, i) => {
            var btn = document.createElement('button');
            btn.className = 'trip-btn';
            btn.onclick = () => loadTrip(i);
            btn.innerHTML = 'Trip ' + t.id + ' (' + t.pickup.split('T')[0] + ')';
            container.appendChild(btn);
        });

        // Initial draw
        drawFlow();
    </script>
